import React from 'react';
import './App.css';
import PinContainer from './containers/PinContainer.js';
import Home from './components/Home.js';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';


const App = (props) => {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/maps/:id" render={(props) => {
            <PinContainer
              id={props.match.params.id}
              pinInput={false}
              canvasInfo={false}
             />
          }}/>
          <Route path="/maps/:id/pins/new" render={(props) => (
            <PinContainer
              id={props.match.params.id}
              pinInput={true}
              canvasInfo={false}
             />
          )}/>
          <Route path="/maps/:id/pins/edit" render={(props) => (
            <PinContainer
              id={props.match.params.id}
              pinInput={true}
              canvasInfo={false}
             />
          )}/>
          <Route path="/maps/:id/info" render={(props) => {
            <PinContainer
              id={props.match.params.id}
              pinInput={false}
              canvasInfo={true}
             />
          }}/>
          <Route path="/" component={Home} />
          <Redirect from="*" to="/" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
